import React from 'react';
import axios from 'axios';

import './App.css';

function App() {



  React.useEffect(() => {
    try {
      axios.get(`api.openweathermap.org/data/2.5/weather?q=Russian,uk&callback=test&appid=${process.env.REACT_APP_OPENWEATHER_KEY}`).then(res => console.log(res.data));
    } catch(error) {
      console.log(error);
    }
  }, [])

  return (
    <div className="App">
      <header className="App-header">
       hello  
      </header>
    </div>
  );
}

export default App;
